‚Äî 45% airdrop to current OUR holders, to offset any losses if we were to not burn the coins, allowing the early investors to stake and grow their OUR;

‚Äî 15% airdrop to Komodo holders, to gain more interest in the project, to spread the supply out more evenly ensuring fair distribution without having 1 or 2 people holding most of the supply, 
as well as a thank you for the platform which has made this whole project possible for us;

‚Äî 5% reserved for twitter contests and discord drops, to thank you all for being in this community and to have small giveaways and contests;

‚Äî 25% Auctioned off in 30 lots of 250,000 OUR for BTC, the BTC of which will be held in a publically viewable address, with the BTC funds dedicated solely for the purpose of
coin listings and advertisement in the future. This would be a better solution than the current model of asking for donations to list on bigger exchanges, as well as giving everyone a chance to get
some more OUR at cheaper rates. This allows us to receive BTC without having to sell our native token, or causing downward price pressure while solving the issue of raising BTC for exchange listings;

‚Äî 10% Founders to use for further development of the platform.

This small early inflation would also lower the entry point into our OCU investment and loaning platform, allowing more people to get a higher membership tier for the same amount of OUR held.
